import React from "react";
import AppLayout from "../components/AppLayout";

const Profile = () => {
  return (
    <>
      <Head>
        <title>프로필</title>
      </Head>
      <AppLayout>프로필 페이지</AppLayout>
    </>
  );
};

export default Profile;
